import * as React from 'react';
import './how_works.css';
import right_arrow_icon from '../img/baseline-arrow_right_alt-24px.svg';

export class HowWorks extends React.Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className="container" id="how-works-lab">
                <div className="col-sm-5">
                    <h3>Como funciona a pré-aceleração?</h3>
                </div>
                <div className="container row textos-lab">
                    <div className="col-sm-4 texto-esquerdo">
                        <p>No StartupLAB, a equipe receberá todo o apoio, mentoria, material teórico e conexão com empreendedores para tornar sua ideia em realidade.</p>
                        <div className="botao-lab">
                            <button type="button" className="button-primary" href="#">Saber mais</button>
                        </div>
                    </div>
                    <div className="col">
                        <p>- 100% gratuito para todos os alunos e ex-alunos da USP</p>
                        <p>- Apoio e mentoria de fundadores e profissionais de startups</p>
                        <p>- Oferecimento gratuito de materiais montados pelo time NEU</p>
                        <p>- Encontros semanais com outras equipes de nossa pré-aceleração</p>
                    </div>
                </div>

            </div>
        )
    }
}
